input0 = ''
input1 = ''
input2 = ''
input3 = ''
input4 = ''

inputs = []
lines = []
inputs.push(input0, input1, input2, input3, input4)

inputs.each do |input|
  lines << input.chars
end

keys = [[1, 2, 3], [4, 5, 6], [7, 8, 9]]

code = []

lines.each do |line|
  x_axis = 1
  y_axis = 1
  line.each do |move|
    case move
      when 'U' then
        y_axis -= 1
      when 'D' then
        y_axis += 1
      when 'L' then
        x_axis -= 1
      when 'R' then
        x_axis += 1
    end
    x_axis = [[x_axis, 2].min, 0].max
    y_axis = [[y_axis, 2].min, 0].max
  end
  code << keys[x_axis][y_axis]
end
puts code





